1. In regard to existing ckBTC fees generated by the Sentinel game - will these be retained by the treasury, or will 80% be returned to users (in alignment with new fee structure)? This obviously isn’t something that is owed, but I’m curious if a refund for users is in order here (as that’s now a lot of playtime for Sentinels). 

2. I remember you had mentioned it would be about an hour of development work to get the Glitch Motoko selection canister in order - are you still on track for this week, and do you have a more concrete timeline for us to begin marketing?

@bobbodily I think some conditions are needed for making the game meaningful. For example;
Option1 to make the snapshot date unclear. People are worried about the date of it and try to get more XP in haste.
Option2 To make the snapshot date clear(and it should be near future.). People think whether they should spend more time and cost and get more XP or save cost and time because Rune token’s value is unclear.
Option3 To make possible XP unlimited. People who want more Rune token will choose easy mission and others won’t.

